import Modal from 'react-modal'

const modalStyle = {
    content: {
        top: '50%',
        left: '50%',
        right: 'auto',
        bottom: 'auto',
        marginRight: '-50%',
        transform: 'translate(-50%, -50%)',
    },
};

Modal.setAppElement('#telephone');

function Contact () {



    return (
        <div id="contact">
            <h2>Contact Me</h2>
            <a className="contactIcon" href="mailto:guilherme.moret.ps@gmail.com">
                <EmailIcon
                    fontSize="large"
                />
            </a>
            <a className="contactIcon" href="">
                <WhatsAppIcon
                    id="telephone"
                    fontSize="large"
                />
            </a>
        </div>
    );
}

export default Contact;
